                            var oldAsset = physicsScene.getObjectByName(data.asset.id, true);
                            var mass = 1
                            
                            physicsScene.remove(oldAsset);
                            
                            var newAsset = ConvertThreeToPhysi(data.asset, mass);
                            newAsset.previousState = oldAsset;
                            
